Happy Asexuality Day🖤🤍💜

I always get questions & comments, if I’m on the ace-spec, why do I pole dance, or dress the way I do? 

As @theyasminbenoit said recently, “I don’t think anyone’s sexual identity should impact the way they’re allowed to dress.”

Ace people don’t “look” a certain way. The thing that makes someone Ace is their lack of sexual attraction to other people. 
Expression of sexuality ≠ sexual attraction 
Libido ≠ sexual attraction 

Not all Ace people are sex-repulsed, most of us are sex-positive, and many of us have wonderful and intimate relationships regardless if there is a lack of physical intimacy or not. Ace people can have high libido but still not be interested in sexual intimacy with someone else. It’s like being hungry but nothing in the fridge looks good to eat. 

The ace spec is one of the most broad, and at the end of the day, there’s just so many ways to be human. 

Anyway, here are some other Ace-spec people to follow!
